pragma solidity >=0.4.22 <0.6.0;

// "x" -> 1 
// "o" -> 2

contract tictactoe {
    uint[] board = new uint[](9);
    address  player1;
    address  player2;
    uint[][] pattern = [[0,1,2],[3,4,5],[6,7,8], [0,3,6],[1,4,7],[2,5,8], [0,4,8],[2,4,6]  ];

    uint turn = 0;
    uint private p1_bet;
    uint private p2_bet;
    bool p1_in = false;
    bool p2_in = false;
    uint num_games = 0;
    uint num_moves = 0;
    uint[] score = new uint[](2);

    function joinplayer1() public payable returns (string memory){
        if(p2_in || p1_in) return "A game in progress";
        player1 = msg.sender;
        p1_bet = msg.value;
        p1_in = true;
        return "You've joined the game";
    }


    function joinplayer2() public payable returns(string memory){
        if(!p1_in || p2_in) return "wait for player1 to join";
        player2 = msg.sender;
        p2_bet = msg.value;
        p2_in = true;
        return "Game begins!!!!!";
    }

    function init_board(uint inc) public {
        for(uint i = 0;i < 9;i++)
        {
            board[i] = 0;
        }
        turn = inc % 2;
    }

    // function move(uint cell, uint pl) public returns (int) {
    function move(uint cell) public returns (int) {
        if(board[cell]!=0) return -1;
        board[cell] = turn + 1;
        // if(isWin() == 1)
        // {
        //     score[pl] += 1;
        //     return 1; 
        // }  
        turn ^= 1;
        return 0;
    }

    // function isWin() public returns (uint){
    //     for(uint i = 0;i < 8 ; i++)
    //     {
    //         uint[] memory b = pattern[i];
    //         if(board[b[0]] != 0 && board[b[0]] == board[b[1]] && board[b[0]] == board[b[2]]) 
    //             return 1;
    //     }
    //     return 0;
    // }


    function game() public returns (string memory){
        if(!p1_in || !p2_in) return "Can't play a game without two players";

        if(num_games == 4)
        {
            uint total_bet = p1_bet+p2_bet;
            if(score[0] > score[1])
            {
                player1.transfer(total_bet);
            }
            else if( score[1] > score[0])
            {
                player2.transfer(total_bet);
            }
        }

    }


}
